handOff -> ?RT_BER:encode_enumerated(5,TagIn ++ []);
{asn1_enum,Enumval1} -> ?RT_BER:encode_enumerated(Enumval1,TagIn ++ []);
Enumval2 -> exit({error,{asn1, {enumerated_not_in_range,Enumval2}}})
end.


